create table MOCK_DATA (
	product_id INT,
	category VARCHAR(24),
	payment_type VARCHAR(11),
	price DECIMAL(7,2),
	rating INT,
	product_name VARCHAR(50),
	brand VARCHAR(50),
	color VARCHAR(50),
	size VARCHAR(6),
	material VARCHAR(9),
	weight DECIMAL(4,2),
	dimensions VARCHAR(8),
	quantity INT,
	availability VARCHAR(50),
	discount_percentage DECIMAL(4,2),
	shipping_cost DECIMAL(5,2),
	seller_name VARCHAR(50),
	seller_rating INT,
	seller_location VARCHAR(50),
	customer_name VARCHAR(50),
	customer_email VARCHAR(50),
	customer_age INT,
	customer_gender VARCHAR(50),
	customer_address VARCHAR(50),
	customer_city VARCHAR(50),
	customer_country VARCHAR(50),
	customer_postal_code VARCHAR(50),
	payment_date DATE,
	delivery_date DATE,
	order_status VARCHAR(9)
);
